/**
 * Create a type-safe Objective-C delegate object.
 *
 * Wraps NobjcProtocol.implement() with full type inference —
 * method names, parameter types, and return types are all inferred
 * from the protocol name string.
 *
 * @example
 * const delegate = createDelegate("NSWindowDelegate", {
 *   windowDidResize$(notification) {
 *     console.log("Window resized!");
 *   },
 * });
 */
export function createDelegate<K extends keyof ProtocolMap>(
  protocolName: K,
  methods: Partial<ProtocolMap[K]>,
): NobjcObject {
  return NobjcProtocol.implement(
    protocolName,
    methods as Record<string, (...args: any[]) => any>,
  );
}
